void printTheString(const  int &limit, vector<string> &text) {
	
		string sentence;

		for (auto it:text )
		{
			string delim = "";
		
			if (limit - sentence.size() >= 1)
			{
				if (sentence.size() >= 1)
				{
					delim = " ";
				}
				
				sentence += delim;
				if (it.size()+sentence.size()<=limit)
				{
					sentence += it;
				}
				else
				{
					cout << sentence << endl;
					sentence = it;
				}

			}
			else
			{
				cout << sentence<<endl;
				sentence = it;
			}

		}
		cout << sentence;
		return;
}
