/**
 * Definition for singly-linked list.
 * public class ListNode {
 *     int val;
 *     ListNode next;
 *     ListNode() {}
 *     ListNode(int val) { this.val = val; }
 *     ListNode(int val, ListNode next) { this.val = val; this.next = next; }
 * }
 */
class Solution {
    public ListNode addTwoNumbers(ListNode l1, ListNode l2) {
        ListNode head = null;
        ListNode l3 = head;

        int hand = 0;
        while (l1 != null && l2 != null) {
            int value = 0;

            if (l1 == null) {
                value = l2.val + hand;
                l2 = l2.next;
            } else if (l2 == null) {
                value = l1.val + hand;
                l1 = l1.next;
            } else {
                value = l1.val + l2.val + hand;
                l1 = l1.next;
                l2 = l2.next;
            }
            l3 = new ListNode();
            if (value >=10) {
                value -= 10;
                hand = 1;
            } else {
                hand = 0;
            }
            System.out.println(value);
            l3.val = value;
            l3 = l3.next;
        }
        if (hand != 0) {
            l3 = new ListNode();
            l3.val = hand;
        }
        return head;
    }
}

