using System;
using System.ComponentModel;
using System.Threading;

namespace BackgroundWorkerExample
{
    class Program
    {
        static BackgroundWorker worker1;
        static BackgroundWorker worker2;
        static BackgroundWorker worker3;

        static void Main()
        {
            worker1 = new BackgroundWorker();
            worker2 = new BackgroundWorker();
            worker3 = new BackgroundWorker();

            worker1.DoWork += Function1;
            worker2.DoWork += Function2;
            worker3.DoWork += Function3;

            worker1.RunWorkerAsync();
            worker2.RunWorkerAsync();
            worker3.RunWorkerAsync();

            Console.WriteLine("All functions started.");

            while (worker1.IsBusy || worker2.IsBusy || worker3.IsBusy)
            {
                // Do nothing, wait for completion
            }

            Console.WriteLine("All functions completed.");
        }

        static void Function1(object sender, DoWorkEventArgs e)
        {
            Thread.Sleep(1000);
            Console.WriteLine("Function 1 completed.");
        }

        static void Function2(object sender, DoWorkEventArgs e)
        {
            Thread.Sleep(2000);
            Console.WriteLine("Function 2 completed.");
        }

        static void Function3(object sender, DoWorkEventArgs e)
        {
            Thread.Sleep(1500);
            Console.WriteLine("Function 3 completed.");
        }
    }
}

